import './App.css';

import { Route, Link,Switch, BrowserRouter } from 'react-router-dom'
import Homepage  from './Home';
import Contactpage  from './Contact';


function App() {
  return (
    <div className="App">
      < BrowserRouter >
      <nav>
      <Link to="/">
            <i className="nav-link glyphicon glyphicon-home"></i> <span>Home</span>
        </Link>
        <Link to="/contactus">
            <i className="navlink glyphicon glyphicon-camera"></i> <span>Contact us</span>
        </Link>
      </nav>
      <div>
      <Switch>
          <Route exact path="/" component={Homepage} />
          <Route exact path="/contactus" component={ Contactpage } />

      </Switch>
      </div>
   </ BrowserRouter >
    </div>
  );
}

export default App;
